B.zW=new A.aQ("Bluetooth","Stability improvements","### Restarting the system after disabling Bluetooth is no longer required.")
B.zh=new A.aQ("Internet access","USB tethering for Android","### USB tethering from Android phones is now supported in Tesla Android. No configuration is required to enable this feature. Your Android phone will be detected as an external ethernet interface when you enable tethering.")
B.zg=new A.aQ("Internet access","LTE modem support","### 2022.45.1 introduces support for USB network devices using the cdc_ncm driver - it has been validated and works without any additional steps from the user. Experimental changes that might enable support for cdc_mbim and rndis_host drivers are also included. Previous versions supported only the cdc_ether driver.")
