B.zd=new A.aQ("Offline Mode","LTE modem is now optional","### Starting with version 2022.27.1 the LTE modem is not required for Tesla Android to maintain connection with your car.\n### Keep in mind that certain online features might not be available in your car as it expects the Wi-Fi network to replace the connectivity provided by Tesla.\n### When using the Offline Mode turning off Wi-Fi on your touchscreen or powering off Tesla Android is required for accessing your car with the Tesla Mobile App while parked.\n### Tesla Android can still be used to provide internet to your car like in previous build - no extra configuration changes are required.")
B.zq=new A.aQ("Wi-Fi","Persistent connection with your Tesla","### As a result of introducing the new Offline Mode Wi-Fi stability and connection times have been significantly improved.\n### If you use the (now optional) LTE modem to get a full Android experience your Wi-Fi with the car won't disconnect when there is no LTE coverage(highways, underground parking etc)")
B.zO=new A.aQ("Virtual display","Quality improvements","### Video stream quality has been slightly improved after reducing the image compression.")
B.zA=new A.aQ("Flutter Frontend","Stability improvements","### Flutter Frontend has been updated in order to improve user experience.\n### Framework version has been bumped to 3.0.4. Rendering engine has been switched to HTML from CanvasKit due to problems with offline loading in Flutter.")
B.Ej=A.a(s([B.zd,B.zq,B.zO,B.zA]),t._X)
B.SO=new A.hg("2022.27.1",B.Ej)
B.zf=new A.aQ("Virtual display","Performance improvements","### Display component has been refactored in order to allow up to 60Hz refresh rate.\n### Tesla Android will now behave normally when loaded in Drive or Reverse.\n### Simplification of video stack improves stability of the Flutter application running in the Tesla Browser.")
B.zC=new A.aQ("Audio Output","Combined audio streams","### Audio from Android is routed directly to your Tesla Browser.\n### Playback is allowed even when Drive or Reverse is engaged, meaning that there is no need to pair Tesla Android with your car using Bluetooth(Bluetooth link with the car is only used by your phone for Android Auto or CarPlay).\n### Audio output from Tesla Browser does not pause media playback from Tesla OS or CarPlay. \n### In order to active this feature open Audio Capture app on your Tesla Android after installing the OS. It will automatically launch on each boot later. Audio Capture can be terminated using a button present in the status notification.\n### Not all apps support audio capture, this restriction will be removed in a feature update.")
B.zn=new A.aQ("Flutter Frontend","Stability improvements","### Flutter Frontend has been updated in order to improve user experience.\n### Loading times have been improved significantly.\n### All major components of the app now have proper state management and error handling.")
B.zN=new A.aQ("Android Platform","Move to Android 12.1","### Tesla Android has been migrated to Android 12.1 from AOSP Master in order to improve stability.\n### Release 2022.25.1 includes Android security updates up to May 5, 2022.")
B.zk=new A.aQ("Orientation lock","All apps launch in landscape","### Tesla Android now includes a working orientation lock for third party apps.\n### This feature allows phone apps like Apple Music to launch in landscape.")
B.zQ=new A.aQ("Google Play Store","App discoverability","### Google Play Store has been replaced with Aurora Store, an Open Source alternative that includes Device Spoofing(emulating Google certification).\n### Google Play Services have been replaced with microG(Open Source Google Apps).\n### FDroid(Open Source App Store that does not rely on Google Play Store) is also included.")
B.zc=new A.aQ("Video Streaming","DRM support","### Tesla Android now supports DRM video playback. Apps like Netflix function normally in version 2022.25.1")
B.zI=new A.aQ("CarPlay","Audio/Video improvements","### Default resolution of CarPlay is a perfect match for Tesla Android in this release(no content overlapping in audio apps).\n### Navigation sounds also work, however this feature is active only when Tesla Browser is active.")
B.zw=new A.aQ("CPU management","Lower power consumption","### Release 2022.25.1 does not use the Performance CPU governor.\n### CPU frequency is now scaled accordingly to CPU load.")
B.zr=new A.aQ("Setup","Simplified device configuration","### Setup process of Tesla Android has been simplified, meaning several steps are no longer needed(obtaining a device identifier for Google Services, switching CarPlay resolution etc).")
B.Eo=A.a(s([B.zf,B.zC,B.zn,B.zN,B.zk,B.zQ,B.zc,B.zI,B.zw,B.zr]),t._X)
